import logo from './logo.svg';
import './App.css';
import {Switch,Routes} from 'react-router-dom';
import Navbar from './components/navbar';

function App() {
  return (
    <div className="App">
       <switch>
        <Route exact path="/" component={Navbar}/>
       </switch>
    </div>
  );
}

export default App;
